// DM Serif Display Regular — Google Fonts (OFL License)
// Auto-generated base64 font for jsPDF
// Used for serif titles in Talent à Impact template (header "TALENT IMPACT" + titre du poste)

const PlayfairFont = (() => {
  const base64Data = '';

  function register(doc) {
    if (!doc || typeof doc.addFileToVFS !== 'function') return;
    try {
      doc.addFileToVFS('DMSerifDisplay-Regular.ttf', base64Data);
      doc.addFont('DMSerifDisplay-Regular.ttf', 'Playfair', 'normal');
      doc.addFont('DMSerifDisplay-Regular.ttf', 'Playfair', 'bold');
    } catch (e) {
      console.warn('PlayfairFont: registration failed', e);
    }
  }

  return { register };
})();
